IPFS Storage Engine is a distributed storage engine based on IPFS . The StorageEngineIPFS ins an implementation of IFileSystem and IFileIndex that handle all I/O operations and indexing. /** * An interface of file engine, depend on the environment * file engine could be different */
export interface IFileSystem<S, T, R> { writeBytes(_data: R): Promise<T>; write(_filename: S, _data: R): Promise<T>; read(_filename: S): Promise<R>; remove(_filename: S): Promise<boolean>;
} /** * Method that performing index and lookup file */
export interface IFileIndex<S, T, R> { publish(_contentID: T): Promise<R>; republish(): void; resolve(_peerID?: S): Promise<T>;
} /** * IPFS file system */ export type TIPFSFileSystem = IFileSystem<string, CID, Uint8Array>; /** * IPFS file index */
export type TIPFSFileIndex = IFileIndex<PeerId, CID, IPNSEntry>; The relationship between StorageEngineIPFS and other classes/interfaces is shown below: classDiagram LibP2pNode -- StorageEngineIPFS Helia-- StorageEngineIPFS UnixFS -- StorageEngineIPFS IPNS -- StorageEngineIPFS IFileSystem &lt;|-- StorageEngineIPFS IFileIndex &lt;|-- StorageEngineIPFS IFileSystem : writeByte(data Uint8Array) CID IFileSystem : write(filename string, data Uint8Array) CID IFileSystem : read(filename string) Uint8Array IFileSystem : remove(filename string) boolean IFileIndex : publish(contentID CID) IPNSEntry IFileIndex : republish() void IFileIndex : resolve(peerID PeerId) CID StorageEngineIPFS : static getInstance(basePath, config) In our implementation, we used datastore-fs and blockstore-fs to persist changes with local file, for now browser is lack of performance to handle connections and I/O. So the best possible solution is provide a local node that handle all I/O and connection. Usage of IPFS Storage Engine The database will be cached at local to make sure that the record are there event it's out live of liveness on IPFS network. To start an instance of StorageEngineIPFS we need to provide a basePath and config (we ignored config in this example): const storageIPFS = await StorageEngineIPFS.getInstance( "/Users/chiro/GitHub/zkDatabase/zkdb/data"
